'use strict';
 
var React = require('react-native');
var Mosaic = require('./mosaicView.ios');
var Camera = require('./cameraView.ios')
var {
  StyleSheet,
  TouchableHighlight,
  View,
  Text,
  Component,
  TextInput,
  TabBarIOS,
  NavigatorIOS,
  Navigator,
  Image,
  AppStateIOS,
  
} = React;

var cameraBase64Icon = 'data:image/png;base64,'
var mosaicBase64Icon = 'data:image/png;base64,'
//Tab Bar Instance contains a Camera Tab and a Mosaic Tab
//You can toggle between the two
class TabView extends Component {
  constructor(props){
    super(props);

    this.state = {
      selectedTab: 'mosaic',
      eventCode: this.props.eventCode,
      mainNavigator: props.mainNavigator,
      facebookId:this.props.facebookId,
      navRef:this.props.navRef,
    }
  }

 
  componentDidMount() {
    console.log('MOUNTING')
    this.state.navRef.setState({navBarHidden:true});
  }

  /**
   * [setSelectedTabCallBack allows for user to be taken to Mosaic Tab after a picture has been saved]
   * @param {[string]} tab [Selected Tab]
   */
  setSelectedTabCallBack(tab){
    this.setState({selectedTab:tab})
  }

  render() {
    
  
    return (
  
  	  
      <TabBarIOS selectedTab={this.state.selectedTab}>
        <TabBarIOS.Item
            icon={{uri: cameraBase64Icon, scale: 2}}
            selected={this.state.selectedTab === 'camera'}
            title= 'Camera'
            onPress={() => {
                this.setState({
                    selectedTab: 'camera'
                });
            }}>
        
        <Camera facebookId={this.state.facebookId} mainNavigator={this.state.mainNavigator} eventCode={this.state.eventCode} selectedTab={this.setSelectedTabCallBack.bind(this)}/>      
        </TabBarIOS.Item>
        <TabBarIOS.Item
            
            selected={this.state.selectedTab === 'mosaic'}
            title= 'Mosaic'
            onPress={() => {
                this.setState({
                    selectedTab: 'mosaic'
                });
          }}>

          <Mosaic facebookId={this.state.facebookId} eventCode={this.state.eventCode} nav={this.state.mainNavigator}/>
        </TabBarIOS.Item>
      </TabBarIOS>
      
      
    );
  }

  
}

var styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#1B2B32',
  },
  description: {
      fontSize: 30,
      textAlign: 'center',
      color: '#FFFFFF'
  },
  tabBarItem : {
    fontSize: 12,
    color: '#000',
  },
  tabBarItemIcon: {
    height:25,
    width:25,
  },
   header: {
      flex:1,
      position:'absolute',
      alignSelf:'stretch',
      backgroundColor:'#1B2B32',
      top:0,
      left:0,
      width:400,
      height:60,
    }, 

});

module.exports = TabView;